  return (
    <>
      <div>
        <Header />
      </div>
      <div className="mt-24">
        <form>
          <input placeholder="title" type="text"></input>
          <input placeholder="paragraph" type="text"></input>
        </form>
      </div>
    </>
  );
}

export default AddNewBlog;
